import React from 'react';
import PropTypes from 'prop-types';

const Button = ({ type='button'}) => {
    return (
        <button
            className='button'
        >
            {children}
        </button>
    );
};

Button.propTypes = {
    type: PropTypes.string,
    clicked: PropTypes.func
};

export default Button;
